tables.table_schema:
CREATE TABLE Quantum_Algorithms (
	algorithm_id INT PRIMARY KEY,
	algorithm_name VARCHAR(255),
	parallelization_level INT
);

CREATE TABLE QuantumAlgorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    parallelization_level INT
);

CREATE TABLE QuantumComputers (
    id INT PRIMARY KEY,
    brand VARCHAR(255),
    model VARCHAR(255),
    qubits_count INT
);

CREATE TABLE QuantumCircuits (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    description TEXT,
    num_gates INT
);

CREATE TABLE QuantumGateLibrary (
    id INT PRIMARY KEY,
    gate_name VARCHAR(255),
    gate_type VARCHAR(255)
);

CREATE TABLE QuantumTasks (
    id INT PRIMARY KEY,
    task_name VARCHAR(255),
    created_at TIMESTAMP,
    completed BOOLEAN
);
